import axios from 'axios';

export function meFromToken(tokenFromStorage) {
  const request = axios({
    method: 'get',
    // body: {},
    url: `https://jastegri.pythonanywhere.com/auth/users/me/`,
    headers: {
      Authorization: `Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ0b2tlbl90eXBlIjoiYWNjZXNzIiwiZXhwIjoxNjEwMDE3MzkxLCJqdGkiOiI5ZjY1ZTJiNjA0N2E0OTM5OWI1NGEyNzgzZGJkMjg5YSIsInVzZXJfaWQiOjUxfQ.pQjci4rZpHSOlcgJA8bdo-RNi7cVOaXoHnOwh_yAklo`,
    },
  });

  return {
    type: 'ME_FROM_TOKEN',
    payload: request,
  };
}

